import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

// This is a react component (custom html element)
// It is the apps root component
// all other components eill be rendered within it

const style = {
  ul: {
    listStyleType: 'none',
    paddingLeft: 0}
  ,
li: {
  display: 'inline-block',
  padding: '1em',
  border: '1px solid grey'
}

}
export default function App() {
  const {ul, li} = style;
  return (
    <div className="container">
      <h1 className="display-4 mt-4 mb-4">React Router</h1>
      <hr />
      <ul style={ul}>
        <li style={li}><a href="#">Home</a></li>
        <li style={li}><a href="#">About</a></li>
        <li style={li}><a href="#">Contact</a></li>
      </ul>
      <HomePage />
      <AboutPage />
      <ContactPage />
    </div>

  );
}

function HomePage() {
  return <p>Home Page</p>;
}

function AboutPage() {
  return <p> About Page</p>

}

function ContactPage() {
  return <p> Contact Page</p>
}
